package com.example.breeze0events;

import static androidx.test.espresso.Espresso.onData;
import static androidx.test.espresso.Espresso.onView;
import static androidx.test.espresso.action.ViewActions.click;
import static androidx.test.espresso.matcher.ViewMatchers.withId;
import static androidx.test.espresso.matcher.ViewMatchers.withText;

import static org.hamcrest.Matchers.not;
import static org.junit.Assert.assertNull;
import static org.junit.Assert.fail;

import android.content.Intent;

import androidx.test.core.app.ActivityScenario;
import androidx.test.core.app.ApplicationProvider;
import androidx.test.espresso.IdlingPolicies;

import com.google.firebase.firestore.FirebaseFirestore;

import org.hamcrest.Description;
import org.hamcrest.Matcher;
import org.hamcrest.TypeSafeMatcher;
import org.junit.After;
import org.junit.Before;
import org.junit.Test;

import java.util.Arrays;
import java.util.concurrent.TimeUnit;

public class US030301 {
    public static Matcher<Object> withItemContent(final String text) {
        return new TypeSafeMatcher<Object>() {
            @Override
            public boolean matchesSafely(Object item) {
                return item.toString().contains(text);
            }

            @Override
            public void describeTo(Description description) {
                description.appendText("List item with text: " + text);
            }
        };
    }
    private OverallStorageController overallStorageController;
    private String mockEventId;
    @Before
    public void setup() {
        IdlingPolicies.setMasterPolicyTimeout(5, TimeUnit.SECONDS);

        overallStorageController = new OverallStorageController();

        Event mockEvent = new Event(
                "Mock test ID",
                "Mock Event Name",
                "MockQRCodeValue",
                "",
                "MockFacility",
                "2024-11-11",
                "2025-11-11",
                "100",
                "false",
                Arrays.asList("entrant1"),
                Arrays.asList("organizer1")
        );

        overallStorageController.addEvent(mockEvent);
        mockEventId = mockEvent.getEventId();
    }

    @After
    public void tearDown() {
        if (overallStorageController != null) {
            overallStorageController.deleteEvent(mockEventId);
        }
    }
    @Test
    public void testEventRemoveUnage() throws Exception {
        Intent intent=new Intent(ApplicationProvider.getApplicationContext(),AdminBrowseImage.class);
        intent.putExtra("poster","");
        intent.putExtra("event1Id","Mock test ID");
        ActivityScenario<AdminBrowseImage>scenario=ActivityScenario.launch(intent);
        Thread.sleep(3000);
        onView(withId(R.id.delete_button)).perform(click());
        Thread.sleep(1000);
        onData(withItemContent("Mock Event Name"))
                .inAdapterView(withId(R.id.eventsList))
                .perform(click());
        FirebaseFirestore db = FirebaseFirestore.getInstance();
        db.collection("OverallDB").document("Mock test ID")
                .get()
                .addOnCompleteListener(task -> {
                    if (task.isSuccessful() && task.getResult() != null) {
                        String poster_value = task.getResult().getString("posterPhoto");
                        assertNull("Poster photo value should be null after deletion", poster_value);
                    } else {
                        fail("Failed to fetch the event from Firestore");
                    }
                });
        Thread.sleep(1000);
        overallStorageController.getEvent(mockEventId, new EventCallback() {
            @Override
            public void onSuccess(Event event) {
                fail("poster photo was not deleted from the database.");
            }

            @Override
            public void onFailure(String errorMessage) {
                assertNull("poster photo successfully deleted from database", null);
            }
        });
    }

}
